import { objFn } from "../plugins/axios.js";
import headeNav from "~/components/headerNav.vue";
import rentSwiper from "~/components/rentSwiper.vue";
import BtnNav from "~/components/bottom.vue";
export default {
  components: {
    headeNav,
    rentSwiper,
    BtnNav
  },

  asyncData() {
    let NewHouseList = {};
    let rentList = [];
    return objFn.Axios("palmsaleapp/api/v1/build/buildLitsAppm?averagepriceList=&typeList=&areaList=&tenementtypeList=&buildtagList=&hardcoverstandardList", "get", {}, {
      interfaceType: "NEW_HOUSE"
    }).then(res => {
      if (res.status == 200) {
        NewHouseList = res.data;
      }
    }).then(() => {
      return objFn.Axios("agenthouseCutomer/common/homePage", "post", {
        "size": "7"
      }, {
        interfaceType: "RENT_HOUSE"
      }).then(res => {
        rentList = res.data.roomList.map(item => {
          item.image = objFn.concatFileUrl(item.image, 240, 180);
          item.tags = item.tags.split(",", 2);
          return item;
        });
        return {
          NewHouseList,
          rentList
        };
      });
    });
  },

  data() {
    let self = this;
    return {
      banners: ["/1.jpg", "/2.jpg", "/3.jpg"],
      navShow: false,
      nowHouseIndex: 0,
      nowHouseImg: "",
      rentQvyu: "",
      ActiveNum: 1,
      SwiperIndex: 0,
      swiperOption: {
        resistanceRatio: 0,
        mousewheel: true,
        keyboard: true,
        direction: "vertical",
        on: {
          // 轮播滑动的函数
          slideChangeTransitionStart() {
            self.SwiperIndex = this.activeIndex;

            if (this.activeIndex > 0) {
              self.navShow = true;
            } else {
              self.navShow = false;
            }
          }

        }
      },
      renCity: ""
    };
  },

  methods: {
    FindRentBuild(val) {
      // 暂时处理
      window.location.href = `http://zufang.guoanfamily.com/#/HouseList?textSearch=${val}`;
    },

    ChouseHouse(i) {
      // this.nowHouseImg = this.nowHouseImg = this.NewHouseList[i]['firstpicture'];
      this.nowHouseIndex = i;
    },

    Toprove() {
      if (this.nowHouseIndex == 0) {
        this.nowHouseIndex = this.NewHouseList.length - 1;
      } else {
        this.nowHouseIndex--;
      }
    },

    Tonext() {
      if (this.nowHouseIndex == this.NewHouseList.length - 1) {
        this.nowHouseIndex = 0;
      } else {
        this.nowHouseIndex++;
      }
    },

    ShowRents() {
      //
      window.location.href = "http://zufang.guoanfamily.com/#/HouseList";
    },

    Show3d() {
      window.location.href = "http://zufang.guoanfamily.com/#/HouseList";
    },

    ChangeErWeiMa(val) {
      if (val === '1') {
        this.IsAndroid = true;
      } else {
        this.IsAndroid = false;
      }
    }

  },

  created() {},

  beforeMount() {},

  mounted() {// this.nowHouseImg = this.NewHouseList[0]['firstpicture'];
    // console.log(111,this.nowHouseImg);
  }

};

